A description of what is most important to you &lt;br clear="none"/&gt;
&lt;b&gt;Emergency Information : -&lt;/b&gt; Include any essential information that any professional in health and social care should know about the you in any situation, including emergencies.&lt;br clear="none"/&gt;
&lt;span style="font-weight: bold;"&gt;Other Information : -&lt;/span&gt;This could include : - Values, Spirituality/religion, Ethnicity, Culture, Pets, Goals and aspirations, Meaningful activities including leisure activities, visiting places, sport and exercise, listening to music, employment, education, volunteering

&lt;p&gt;A description of how you communicate normally including any communication aids you use, for example a hearing aid.&lt;/p&gt;
&lt;ul&gt;
    &lt;li&gt;Include your preferred language of communication, if your first language is not English.&lt;/li&gt;
    &lt;li&gt;Include how you would communicate when you are in pain or distress.&lt;/li&gt;
    &lt;li&gt;Include how you communicate choices.&lt;/li&gt;
    &lt;li&gt;Include how you give feedback or raise a concern.&lt;/li&gt;
    &lt;li&gt;Include how you like to receive information&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;Describe how you would like others to engage and communicate with you, including how you would like to be addressed.&lt;/p&gt;

&lt;p&gt;A description covering what you are able to do, how you engage with others and how you feel on a typical day through to on a day when you are unwell or really unwell.&lt;/p&gt;
&lt;ul&gt;
    &lt;li&gt;Include any causes that might result in you becoming unwell and strategies for avoiding or addressing the causes. For example, not drinking enough water could cause constipation.&lt;/li&gt;
    &lt;li&gt;Include any signs that indicate you might be becoming unwell.&lt;/li&gt;
    &lt;li&gt;On a bad day describe what is different about what you are able to do, how you engage with others and how you feel.&lt;/li&gt;
    &lt;li&gt;Include how your everyday life is affected by any medical conditions e.g. dementia and any symptoms e.g. itchiness, cough, pain and how you manage those conditions.&lt;/li&gt;
    &lt;li&gt;Include past health issues or experiences that need to be considered&lt;/li&gt;
    &lt;li&gt;Include your wellbeing and lifestyle goals and aspirations&lt;/li&gt;
&lt;/ul&gt;

&lt;p&gt;A description of things you want someone supporting you to do or not to do.&lt;/p&gt;
&lt;p&gt;For example, this might include: - Talk to me not to my carer, remind me to take my medication, encourage me to wash my hands regularly, explain to me what is happening and why, respond to my communication.&lt;/p&gt;
&lt;p&gt;A description of things you do not want someone supporting for you to do. For example, this might include: - Discussing or asking questions about certain topics, making assumptions about something, providing support when it is not wanted, talking to you in a certain way.&lt;/p&gt;

&lt;p&gt;A description of how and when you want someone caring for you to support you.&lt;/p&gt;
&lt;p&gt;This could include support needs in an emergency situation (for example taking blood)&lt;/p&gt;
&lt;p&gt;This could include support you need to maintain important routines or to carry out particular activities, for example: - Personal care routines, Eating and drinking, Bedtime routines, Taking medications, Moving and transitioning&lt;/p&gt;
&lt;p&gt;This could also include support needed with:- wearing glasses/hearing aids/false teeth etc, making informed choices or understanding dangers and risks, managing your emotions, moods and behaviours, memory or confusion.&lt;/p&gt;
&lt;p&gt;Include how your support needs change in different environments. Include any triggers that might result in you needing further support and strategies for avoiding or addressing the triggers. Include how you want the support to be provided.&lt;/p&gt;

&lt;p&gt;A description of what is also worth knowing about you for people caring or supporting you.&lt;/p&gt;
&lt;p&gt;This could include a short history of your life (where you have worked, where you lived, important events in your life, important people in your past life).&lt;/p&gt;
&lt;p&gt;This could include a short profile of your current life:- your work / study, your aspirations, your skills, your networks, things you like e.g. particular foods, places, a football team and things you like to talk about, things you dislike&lt;/p&gt;
&lt;p&gt;This could also include any care and support preferences that have not been included elsewhere.&lt;/p&gt;

&lt;div&gt;
    &lt;br clear="none"/&gt;Description of what the person can do with the impairment, what they want to be able to do and how they should be supported to do it and what the consequences are of not providing the support.&lt;/div&gt;
&lt;div/&gt;
&lt;div&gt;Where there is a sensory disability include sensory processing difficulties (e.g. affects to balance and movement, oversensitive, under-sensitive).&lt;/div&gt;

